import React from 'react';
import './VideoSection.css';

function VideoSection() {
  return (
    <div className='video_background'>
      {/* <h1>Check out these EPIC Destinations!</h1> */}
      <div className='cards__container'>
        <iframe width="560" height="315" src="https://www.youtube.com/embed/z96AggDAv3w" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
        <h1>Sakana Sushi Bar & Japanese Cuisine was voted #1 for best Sushi Restaurant 2010!

To all our voters, loyal customers, and sushi lovers... Thank You!</h1>
      </div>
    </div>
  );
}

export default VideoSection;
